export const ACTIONS = {
  ACTIVE_PAGE: "ACTIVE_PAGE",
  UPDATE_QUOTES: "UPDATE_QUOTES",
};

export function setActivePage(page) {
  return {
    type: ACTIONS.ACTIVE_PAGE,
    page,
  };
}

export function updateQuotes(quoteData) {
  return {
    type: ACTIONS.UPDATE_QUOTES,
    quoteData,
  };
}
